import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const Analysis = () => {
    const { id } = useParams();
    const [company, setCompany] = useState(null);

    useEffect(() => {
        axios.get(`http://localhost:8000/api/companies/${id}/`)
            .then(response => setCompany(response.data))
            .catch(error => console.error('Error fetching company data:', error));
    }, [id]);

    if (!company) return <div>Loading...</div>;

    return (
        <div>
            <h1>Analysis</h1>
            <div>
                <label>Company name: </label>
                <span>{company.name}</span>
            </div>
            <div>
                <label>Address: </label>
                <span>{company.address}</span>
            </div>
            <div>
                <label>Score: </label>
                <span>{company.score}</span>
            </div>
            <div>
                <label>Accuracy: </label>
                <span>{company.accuracy}</span>
            </div>
            <div>
                <label>Risk: </label>
                <span>{company.risk}</span>
            </div>
            <div>
                <label>Analysis summary: </label>
                <span>{company.summary}</span>
            </div>
            {/* Diagram section removed as per your requirement */}
            <button>Update the analysis</button>
        </div>
    );
};

export default Analysis;
